import React from 'react';
import { Code, Calendar, BarChart2, FileSpreadsheet } from 'lucide-react';

const getProjectIcon = (projectType) => {
  switch (projectType) {
    case 'web': return <Code size={40} />;
    case 'scheduling': return <Calendar size={40} />;
    case 'analysis': return <BarChart2 size={40} />;
    case 'data': return <FileSpreadsheet size={40} />;
    default: return <Code size={40} />;
  }
};

const ProjectGrid = ({ projects, openProjectModal }) => {
  return (
    <div className="grid grid-cols-3 gap-6">
      {projects.map((project) => (
        <div
          key={project.id}
          className="aspect-square bg-gray-800 rounded-xl overflow-hidden shadow-lg hover:shadow-2xl transition-all duration-300 cursor-pointer p-6 flex flex-col justify-between"
          onClick={() => openProjectModal(project)}
        >
          <div className="text-purple-300 mb-4">
            {getProjectIcon(project.type)}
          </div>
          <div>
            <h3 className="text-lg font-semibold text-white mb-2">{project.title}</h3>
            <p className="text-sm text-gray-400 line-clamp-2">{project.shortDescription}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ProjectGrid;
